import { useState } from "react";


const Add = () => {

    const [note, setNote]= useState('');

    return(
	<div className="addWrap">
        <input 
            type="text" 
            id="note" 
            className="note" 
            name="note"
            aria-label="note" placeholder="Click to write a note" 
            required 
            value={note}
            onChange={(e)=> setNote(e.target.value)}
            />
	</div>
    );
}

export default Add;
